import React, { useEffect, useState } from "react";
import axios from "axios";

const Clientes = () => {
    const [clientes, setClientes] = useState([]);

    useEffect(() => {
      axios.get("http://localhost:8000/clientes")
        .then(response => {
          console.log("Dados recebidos:", response.data); // Verifique os dados aqui
          setClientes(response.data.clientes);  // Acesse a chave 'clientes' se necessário
        })
        .catch(error => {
          console.error("Erro ao buscar clientes:", error);
        });
    }, []);
    
  

    return (
      <div>
          <h1>Lista de Clientes</h1>
          <ul>
              {Array.isArray(clientes) && clientes.length === 0 ? (
                  <p>Nenhum cliente encontrado</p>
              ) : (
                  clientes.map(cliente => (
                      <li key={cliente.id}>{cliente.nome} - {cliente.email}</li>
                 ))
             )}
         </ul>
      </div>
    );
};

export default Clientes;
